import React from 'react';
import ReactDOM from 'react-dom';
import {TodoLayer} from './context/TodoContext'
import {initialState} from './context/reducer'
import './index.css';
import App from './App';

ReactDOM.render(
  <React.StrictMode>
    <TodoLayer initialState={initialState} >
      <App />
    </TodoLayer>

  </React.StrictMode>,
  document.getElementById('root')
);
